#GTK Window
class MainWindow(Gtk.Window):
    current_frame = 0
    frames = []
    fps = 30
    reverse = False
    resolution = 256

    def __init__(self):
        Gtk.Window.__init__(self, title='gtk_cat.py')
        self.connect("key-press-event", self.key_press_event)

        print('Generating animation...')
        #Load animation
        self.animation = lottie.objects.Animation.load(CAT)
        self.fps = int(self.animation.frame_rate)
        #Generate frames svg
        for i in range(int(self.animation.out_point)):
            self.frames.append(self.generate_frame(i))
        self.current_frame = 0
        
        #Show frames
        print('Begin')
        self.show_frame()
        
    #Generate pixbuf for frame of animation
    def generate_frame(self, i):
        svg_tree = lottie.parsers.svg.builder.to_svg(self.animation, i)
        svg_data = ElementTree.tostring(svg_tree.getroot())
        return Rsvg.Handle.new_from_data(svg_data).get_pixbuf()

    def show_frame(self):
        #Remove old
        if hasattr(self, 'image'):
            self.remove(self.image)

        #Scale
        pixbuf = self.frames[self.current_frame].scale_simple(self.resolution, self.resolution, GdkPixbuf.InterpType.BILINEAR)

        #Display
        self.image = Gtk.Image.new_from_pixbuf(pixbuf)
        self.add(self.image)
        self.show_all()

        if self.fps > 0:
            #Reverse check
            if self.reverse:
                self.current_frame -= 1
                #Last Frame
                if self.current_frame == -1:
                    self.current_frame = len(self.frames)-1
            else:
                self.current_frame += 1
                #Last Frame
                if self.current_frame == len(self.frames):
                    self.current_frame = 0

            GLib.timeout_add(1000/self.fps, self.show_frame)
            return
        #Static
        GLib.timeout_add(100, self.show_frame)

    #Handle key presses
    def key_press_event(self, widget, event):
        key = Gdk.keyval_name(event.keyval).lower()
        #+ - FPS control, CTRL for resolution
        if key == 'plus' or key == 'kp_add':
            #Resolution
            if event.state & Gdk.ModifierType.CONTROL_MASK:
                self.resolution += 64
                print(f'Resolution: {self.resolution}x{self.resolution}')
                return

            self.fps += 1
            print(f'FPS: {self.fps}')
        
        if key == 'minus' or key == 'kp_subtract':
            #Resolution
            if event.state & Gdk.ModifierType.CONTROL_MASK:
                if (self.resolution > 64):
                    self.resolution -= 64
                print(f'Resolution: {self.resolution}x{self.resolution}')
                return
                
            if (self.fps > 0):
                self.fps -= 1
            print(f'FPS: {self.fps}')

        if key == 'r':
            self.reverse = not self.reverse
            print('Reversed!')
        

if __name__ == '__main__':   
    win = MainWindow()
    win.connect("destroy", Gtk.main_quit)
    win.show_all()
    Gtk.main()